import { Typography } from "@material-ui/core";
import * as React from "react"
import './main.css';
import original from './redesign-original.png';
import './project.css';

const Redesign = () => {
    return (
        <div className="project-div">
            <Typography variant='h3' className="project-title">Responsive Redesign</Typography>
            <Typography variant='h4' className="project-subtitle">Introduction</Typography>
            <img id="screenshot" src={original} alt="screenshot of website to be redesigned" />
            <Typography> 
                    This was a project for CS1300: User Interface and Experience at Brown University, in which I redesigned 
                an existing webpage based on usability standards. I analyzed and identified flaws in an existing interface, 
                created low-fidelity and high-fidelity prototypes for various screen sizes, and built a responsive website based 
                on those prototypes.

                I chose to redesign the home page of a local Rhode Island soap business: <a href="http://seafoamtradingco.com/">Newport Sea Foam Trading Co.</a> 
                A screen shot of the homeage is shown.
            </Typography>

            <Typography variant='h4' className="project-subtitle">Identifying Problems</Typography>
            <Typography>
               I analyzed the usability of the website the following criteria: usability, learnability, and memorability.
                   </Typography> 




        </div>
    );
}

export default Redesign;
